  return (
    <div>
    <div
      style={{
        margin: "3% 5%",
        position: "fixed",
        width: "calc(100vw - 275px)",
        height: "100vh"
      }}
    >
      <Input
        id="standard-full-width"
        style={{ width: "calc(100vw - 40%)" }}
        placeholder="Search"
        margin="normal"
        startAdornment={
          <InputAdornment position="start">
            <SearchIcon />
          </InputAdornment>
        }
        InputLabelProps={{
          shrink: true
        }}
      />
      <div className="college-list">
        <Grid container spacing={3}>
          {props.colleges.map((item, index) => {
            return (
              <Grid item xs={6} onClick={handleClick}>
                <Card className={classes.root}>
                  <CardActionArea>
                    <div style={{height:"200px",width:"345px",overflow:"hidden"}}>
                      <img
                        src={item.logo}
                        height="200px"
                        style={{display:"block",marginLeft:"auto",marginRight:"auto"}}
                        alt="sahyadri"
                      />
                    </div>

                    <CardContent>
                      <Typography
                        gutterBottom
                        variant="h5"
                        component="h2"
                        style={{ fontFamily: 'Nunito", sans-serif' }}
                      >
                      {item.college_name}
                      </Typography>
                    </CardContent>
                  </CardActionArea>
                </Card>
              </Grid>
            );
          })}
        </Grid>
      </div>
    </div>
    </div>
  );
}
